import React from 'react';
import {
  BrowserRouter as Router,
  Routes,
  Route,
  Link,
} from "react-router-dom";import Navbar from './components/Navbar/Navbar';
import Dashboard from './screens/dashboard';
import Incomes from './screens/incomes';

function App() {
  return (
    <>
    <Router>
      <Navbar />
      <Routes>
        <Route exact path="/screens/incomes" component={Dashboard} />
        <Route path="/screens/incomes" component={Incomes} />
      </Routes>
    </Router>
    <h1>Hello</h1>
    </>
  );
}

export default App;
